import React from 'react';
import MyDate from './MyDate';
import './LogItem.css'

const LogItem = () => {
    return (
        <div className='item'>
            <MyDate/>

            {/* 日志内容容器 */}
            <div className='content'>
                <div className='desc'>学习react</div>
                <div className='time'>35min</div>
            </div>
        </div>
    );
};

export default LogItem;
